import React from "react";
import {Link} from "react-router-dom";

const NavBar = () => {
    return (
        <div className="top-part">
        <ul>
      <li><a href="#about" >About</a></li>
      <li><Link to="/work" >Work</Link></li>
      <li><Link to="/contact" >Contact</Link></li>
    </ul>
        </div>
    )
}

export default NavBar;
